<template>
  <div class="passwordPage">
    <p class="isTitle">{{ dataList.isTitle }}</p>
    <input type="text" id="tradePin" name="tradePin" value maxlength="6" placeholder="请输入支付密码" />
    <p class="briefVal">{{ dataList.briefVal }}</p>

    <div id="login_keyboard" style="position: relative"></div>
  </div>
</template>

<script>
import { Captcha, Toast } from 'mand-mobile';
import * as store2 from '@/common/localstore';
import api from '@/common/apiUrls';
import { Keyou } from '@/common/keyou-crypto-min.js';

export default {
    inject: ['reload'],
    props: ['dataList'],
    components: {
        [Captcha.name]: Captcha
    },
    data() {
        return {
            maxlength: 6,
            isTitle: false,
            subList: {
                subVal: true,
                subId: '',
                mima: '',
                toast: ''
            },
            KeyouCryptography: null
        };
    },
    mounted() {
        if (this.KeyouCryptography == null) {
            this.KeyouCryptography = Keyou();
        }
        // eslint-disable-next-line max-len
        const license = '';
        const options = {
            parentNodePC: '#login_keyboard', // PC端键盘弹出后对应的父元素节点 id
            isOpenKeyboardTitleMD: true, // 控制移动端键盘的标题栏是否显示
            opacityMD: '0', // 移动端遮罩层的透明度
            allowRealKeyboardInputPC: false, // PC端键盘允许通过物理键盘输入
            heightMD: document.body.clientHeight * 0.4,
            keyboardFontPC: '2em Verdana, Sans-Serif'
        };
        const keyboradRandom = {
            numberRandomMD: false // 数字键盘随机控制
        };
        const numberKeyboard = new this.KeyouCryptography.Keyboard('commonStyle', 6, false, keyboradRandom, license, options);
        // 绑定键盘
        numberKeyboard.bind('tradePin', true);
        // 键盘显示事件
        numberKeyboard.show();
        // 点击确认事件
        numberKeyboard.onSure((event) => {
            console.log(event);
            const SM2pk = '127B605073FC29CFA45AF932A282ED19CF5556CC479C6E003AFED63112DC004AE466E2C32D57A202686420D09D129E5FB19D6BB0E33248D8442A4003C1DD38FF';
            if (event.length === 6) {
                //   获取密码密文
                const ciphertext = numberKeyboard.getCipherWithSM2(SM2pk, false);
                const isCiphertext = String(ciphertext.ciphertext);
                // 获取密码唯一标识
                const ID = numberKeyboard.getUUID();
                store2.default.set('numberKeyboardId', ID);
                // WeakCipherTest
                api.paymentApi
                    .WeakCipherTest({
                        usrid: store2.default.get('usrmob'),
                        encpwd: isCiphertext
                    })
                    .then((data) => {
                        console.log(data,'data');
                        if (data.msg == '交易成功' || data.code == 'RMP00000') {
                            this.subList.subVal = true;
                            this.subList.subId = ID;
                            this.subList.mima = isCiphertext;
                            this.$emit('childByVal', this.subList);
                        } else {
                        this.subList.subVal = false;
                        this.subList.subId = '';
                        this.subList.toast = data.msg
                        this.$emit('childByVal', this.subList);
                        }
                    })
                    .catch((err) => {
                        console.log(err,'err');
                        this.subList.subVal = false;
                        this.subList.subId = '';
                        this.subList.toast = err.msg
                        this.$emit('childByVal', this.subList);
                    });
            } else {
                setTimeout(() => {
                    Toast.info('请输入6位数字密码');
                    this.reload();
                }, 200);
            }
        });

        this.$router.beforeEach((to, from, next) => {
            if (to.name == 'reconfirm') {
                numberKeyboard.show();
                next();
            } else {
                // 键盘隐藏
                numberKeyboard.close();
                next();
            }
        });
    },
    methods: {}
};
</script>

